import React from "react";
import ReactDOM from "react-dom";
//import Image from "./Mep";

function Photo(props){
  return
  <div>
  <img src={props.img}/>
  <h1>{props.imgno}</h1>

  </div>
}





ReactDOM.render(
<div>
<photo img="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcQPxhiZcMvhaJLG5r2g2a41EHLnIxYWxoq_Lw&usqp=CAU"
       imgno="first image"
/>



</div>,
document.getElementById('root'));
